import React, { useState, useEffect } from 'react';

const App = () => {
  const [rules, setRules] = useState([]);

  const fetchRules = async () => {
    try {
      const response = await fetch('http://10.1.37.114:5000/getRules', {
        method: 'POST'
      });
      const data = await response.json();
      setRules(data.data);
    } catch (error) {
      console.log(error);
    }
  };

  useEffect(() => {
    fetchRules();
  }, []);

  const [showDescription, setShowDescription] = useState(false);
  const [descriptionData, setDescriptionData] = useState({});

  const handleViewDescription = (category, detection, label) => {
    setDescriptionData({ category, detection, label });
    setShowDescription(true);
  };

  return (
    <div>
      <button onClick={fetchRules}>Deploy</button>
      <table>
        <thead>
          <tr>
            <th>Checklist</th>
            <th>Model Name</th>
            <th>Rule Name</th>
            <th>Rule Creation Date</th>
            <th>View Description</th>
          </tr>
        </thead>
        <tbody>
          {rules.map((rule, index) => (
            <tr key={index}>
              <td>
                <input type="checkbox" />
              </td>
              <td>{rule['Model Name']}</td>
              <td>{rule['Rule Name']}</td>
              <td>{rule['Rule Creation Date']}</td>
              <td>
                <button
                  onClick={() =>
                    handleViewDescription(
                      rule['Rule Description'][0].category,
                      rule['Rule Description'][0].detection,
                      rule['Rule Description'][0].label
                    )
                  }
                >
                  View Description
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>

      {showDescription && (
        <div>
          <h3>Description</h3>
          <table>
            <thead>
              <tr>
                <th>Category</th>
                <th>Detection</th>
                <th>Label</th>
              </tr>
            </thead>
            <tbody>
              <tr>
                <td>{descriptionData.category}</td>
                <td>{descriptionData.detection}</td>
                <td>{descriptionData.label}</td>
              </tr>
            </tbody>
          </table>
          <button onClick={() => setShowDescription(false)}>Close</button>
        </div>
      )}
    </div>
  );
};

export default TableComponent;
